import React from "react";
import LargeBox from "../components/LargeBox";
import MediumBox from "../components/MediumBox";
import UpMargin from "../components/UpMargin";
import styles from "./Detail-OLED.module.css";

const OLED = () => {
  return (
    <section>
      <LargeBox />
      <UpMargin />
      <MediumBox /> <MediumBox />
      <div className={styles.mediumBox}></div>
    </section>
  );
};

export default OLED;
